--
-- Funciones
--
CREATE DEFINER=`comunica`@`localhost` FUNCTION `mes` (`_d` DATE, `_locale` VARCHAR(5)) RETURNS VARCHAR(22) CHARSET utf8 COLLATE utf8_general_ci DETERMINISTIC BEGIN
     SET @@lc_time_names = _locale;
     RETURN DATE_FORMAT(_d, '%M');
 END$$

CREATE DEFINER=`comunica`@`localhost` FUNCTION `mesString` (`month_num` TINYINT(11)) RETURNS VARCHAR(255) CHARSET utf8mb4 COLLATE utf8mb4_general_ci DETERMINISTIC BEGIN

DECLARE month_name VARCHAR(20);

    CASE month_num
        WHEN 1 THEN
            SET month_name = 'Enero';
        WHEN 2 THEN
            SET month_name = 'Febrero';
        WHEN 3 THEN
            SET month_name = 'Marzo';
        WHEN 4 THEN
            SET month_name = 'Abril';
        WHEN 5 THEN
            SET month_name = 'Mayo';
        WHEN 6 THEN
            SET month_name = 'Junio';
        WHEN 7 THEN
            SET month_name = 'Julio';
        WHEN 8 THEN
            SET month_name = 'Agosto';
        WHEN 9 THEN
            SET month_name = 'Septiembre';
        WHEN 10 THEN
            SET month_name = 'Octubre';
        WHEN 11 THEN
            SET month_name = 'Noviembre';
        WHEN 12 THEN
            SET month_name = 'Diciembre';
        ELSE
            SET month_name = 'Mes no válido';
    END CASE;

    RETURN month_name;
 END$$

