DELIMITER $$
CREATE TRIGGER `insertar_slider` BEFORE INSERT ON `imgvideo` FOR EACH ROW BEGIN
  	/*cantidad de sliders en un hotel designado*/
     set @cantidad :=IFNULL((select count(*) as cantidad from imgVideo i inner join local  l on cveLocal = idlocal where cveLocal = new.cveLocal and cveSeccion = 1 group by cveLocal),0);
     /*llamo la posicion del ultimo slider registrado*/
     set @pos :=  IFNULL((select posicion from imgVideo i inner join local  l on cveLocal = idlocal where cveLocal = new.cvelocal and cveSeccion = 1 order by posicion desc limit 1),0);
     /*verifico si la posicion que se va a registrar este reptida o no*/
     set @posRepetida :=  IFNULL((select count(*) from imgVideo i inner join local  l on cveLocal = idlocal where cveLocal = new.cveLocal and cveSeccion = 1 and posicion = new.posicion group by cveLocal),0);
  
  
     IF @cantidad  = 0
  	THEN
  		/*Es ajustar el PRIMER slider que se inserta, y que se inserte obligatoriamente en la posicion 1*/
  		set new.posicion = 1;
  	ELSE IF  new.posicion > @pos
      THEN
  		/*Es para ajustar el segundo o el siguiente slider, en su posicion predecesora a la posicion del ultimo insertado, 
          NOTA: ESTE SLIDER NO TIENE QUE CHOCAR CON NINGUNA OTRA POS SLIDER DE LA BD*/
  		set new.posicion = @pos + 1;
      END IF;
  	END IF;
      
      
      IF @posRepetida > 0 
  	THEN
  		set new.posicion = -1;
  	END IF ;
      
   	/*IF @cantidad = 5 and new.cveSeccion = 1
  	THEN
  		signal SQLSTATE '45000';
  	END IF ;*/
          
  	END
$$
