INSERT INTO `araiza_apr_pagina` (`id_arz_apr_pagina`, `titulo`, `descripcion`, `linkVideo`, `linkForm`, `cve_ar_apr`) VALUES
(10, 'Mod. 1. Barra de herramientas y chat.', 'En este módulo, exploraremos las funcionalidades principales de Microsoft Teams, enfocándonos en la barra de herramientas y las capacidades del chat. Microsoft Teams es una plataforma diseñada para facilitar la comunicación y colaboración empresarial. Aquí aprenderás a manejar las herramientas esenciales que te permitirán optimizar tu trabajo en equipo.', 'https://www.youtube.com/embed/zG1qjwi-j54?si=ZwCpoJ1KSnDt4oJP', '', 46),
(11, 'Mod. 2. Canales.', 'En este módulo, nos adentraremos en la estructura y el uso de los canales en Microsoft Teams, una herramienta esencial para la organización y colaboración dentro de equipos. Los canales permiten dividir el trabajo en secciones manejables y facilitan la comunicación dirigida. Aquí aprenderás a distinguir entre equipos y canales, así como a gestionar diferentes tipos de canales para optimizar la colaboración en tu organización.', 'https://www.youtube.com/embed/DZrEbRNQN7A?si=3i4BGPdEOjQVzPdE', '', 47),
(12, 'Mod. 3. Uso de archivos.', 'En este módulo, nos centraremos en cómo gestionar, organizar y compartir archivos dentro de Microsoft Teams. Aprenderás a utilizar las herramientas disponibles para la creación, edición, sincronización y distribución de documentos, lo que te permitirá optimizar la colaboración y mantener un flujo de trabajo eficiente.', 'https://www.youtube.com/embed/bfPa8NcXZxs?si=VltA7XMWexJpk9qE', '', 48),
(13, 'Mod. 4. OneDrive', 'En este módulo, aprenderás sobre la capacidad de almacenamiento de OneDrive, la importancia de guardar archivos en la nube, y las mejores prácticas para la gestión de documentos en Microsoft Teams y OneDrive. Este conocimiento te permitirá optimizar el uso del almacenamiento en la nube y mejorar la colaboración y eficiencia en el manejo de archivos.', 'https://www.youtube.com/embed/Lnuh1cuopMA?si=NS4HYBwDANNKlxub', '', 49),
(14, 'Mod. 5. Calendario y reuniones.', 'En este módulo, nos enfocaremos en cómo gestionar tu calendario y organizar reuniones efectivas utilizando Microsoft Teams. Aprenderás a acomodar tu calendario, programar reuniones virtuales, y utilizar las diversas herramientas disponibles para facilitar la comunicación y colaboración durante las reuniones.', 'https://www.youtube.com/embed/sVtrc5uaA-0?si=5uG4ccWZYDS4NfVE', '', 50),
(15, 'Mod. 6. Reuniones presenciales con Outlook', 'En este módulo, exploraremos cómo utilizar Outlook para organizar y gestionar tu calendario y reuniones. Aprenderás a configurar el horario de trabajo, crear reuniones, y utilizar herramientas para encontrar el mejor horario para todos los invitados, optimizando así la planificación y coordinación de eventos.', 'https://www.youtube.com/embed/dHCiCrxAG7I?si=m-MReER2y-JpZD-q', '', 51);
