INSERT INTO `formulario_ar_apr` (`idFormulario`, `titulo`, `descripcion`, `encabezado`, `seccion_cant`, `id_hotel`) VALUES
(1, 'Angular Components: Test Your Core Knowledge', 'Description', '[]', '[\"10\"]', 1);
INSERT INTO `fpreguntas_ar_apr` (`idPregunta`, `pregunta`, `respuestaCorrecta`, `respuestas`, `cantidadRespuestas`, `fk_formulario`, `tipoPregunta`) VALUES
(1, 'What is a component in Angular?', '1', '[{\"id\":0,\"title\":\"A) A class representing a module.\"},{\"id\":1,\"title\":\"B) A reusable part of the user interface.\"},{\"id\":2,\"title\":\"C) A structural directive.\"},{\"id\":3,\"title\":\"D) A service handling data.\"}]', 1, 1, 2),
(2, 'Rearrange the following sentences to describe how Angular processes a component:', '[0,1,2,3]', '[{\"id\":0,\"title\":\"Initializes the component\'s properties with data.\"},{\"id\":1,\"title\":\"Executes the ngOnInit method.\"},{\"id\":2,\"title\":\"Renders the component’s HTML template.\"},{\"id\":3,\"title\":\"Updates the view when data changes.\"}]', 0, 1, 4),
(3, 'Which file contains the definition of a component in Angular?', '2', '[{\"id\":0,\"title\":\"A) .html\"},{\"id\":1,\"title\":\"B) .css\"},{\"id\":2,\"title\":\"C) .ts \"},{\"id\":3,\"title\":\"D) .json\"}]', 1, 1, 2),
(4, 'Which decorator is used to define a component?', '3', '[{\"id\":0,\"title\":\"A) @Directive\"},{\"id\":1,\"title\":\"B) @Service\"},{\"id\":2,\"title\":\"C) @NgModule\"},{\"id\":3,\"title\":\"D) @Component\"}]', 1, 1, 2),
(5, 'Which property of the @Component decorator is mandatory?', '1', '[{\"id\":0,\"title\":\"A) styleUrls\"},{\"id\":1,\"title\":\"B) selector\"},{\"id\":2,\"title\":\"C) animations\"},{\"id\":3,\"title\":\"D) changeDetection\"}]', 1, 1, 2),
(6, 'Which property in the @Component decorator defines the HTML template file?', '2', '[{\"id\":0,\"title\":\"A) template\"},{\"id\":1,\"title\":\"B) htmlFile\"},{\"id\":2,\"title\":\"C) templateUrl\"},{\"id\":3,\"title\":\"D) htmlPath\"}]', 1, 1, 2),
(7, 'How do parent and child components communicate in Angular?', '1', '[{\"id\":0,\"title\":\"A) Through a service.\"},{\"id\":1,\"title\":\"B) Using the @Input decorator.\"},{\"id\":2,\"title\":\"C) Using the @Output decorator.\"},{\"id\":3,\"title\":\"D) With an Observable.\"}]', 1, 1, 2),
(8, 'How can you send data from a child component to a parent component?', '2', '[{\"id\":0,\"title\":\"A) @Input\"},{\"id\":1,\"title\":\"B) @ViewChild\"},{\"id\":2,\"title\":\"C) @Output\"},{\"id\":3,\"title\":\"D) @Injectable\"}]', 1, 1, 2),
(9, 'Which file contains the metadata for a component in Angular?', '3', '[{\"id\":0,\"title\":\"A) component.html\"},{\"id\":1,\"title\":\"B) component.spec.ts\"},{\"id\":2,\"title\":\"C) component.module.ts\"},{\"id\":3,\"title\":\"D) component.ts\"}]', 1, 1, 2),
(10, 'Which lifecycle method is called after Angular initializes the component\'s input properties?', '0', '[{\"id\":0,\"title\":\"A) ngOnInit\"},{\"id\":1,\"title\":\"B) ngAfterViewInit\"},{\"id\":2,\"title\":\"C) ngOnDestroy\"},{\"id\":3,\"title\":\"D) ngDoCheck\"}]', 0, 1, 2);
